    <script>

        window.onload = () => {
            let templateStr = '0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'
            function randomStr(length, chars) {
                let res = ''
                let myRe = /^\d+/;
                for (let i = 0; i < length; i++) {
                    res += chars[Math.floor(Math.random() * chars.length)]
                }
                if (myRe.test(res)) {
                    res = randomStr(length, chars)
                }
                return res
            }
